import "./tracks.css";

export default function Tracks() {
	return (
		<section id="Tracks" className="h-screen bg-[length:100%_100%]">
			<div className="container mx-auto">
				<div className="text-center">
					<div className="title bg-gradient-to-r from-indigo-400 via-pink-300 to-rose-400 bg-clip-text text-transparent text-7xl text-fruBold w-fit text-left">
						Tracks
					</div>
				</div>
			</div>
		</section>
	);
}
